    "2013-03-15T05:59:55.186014",nt"name": "1-24000-papermap-quadrangle-index-of-louisiana-geographic-nad83-usgs-1999-quad24k-papermap-1999",nt"isopen":
    false,nt"url": null,nt"notes": "This is a polygon dataset delineating the
    geographic footprint of the 24k (7.5') series map sheets published by the USGS.
    Because most of these map sheets have also been scanned into DRGs, this index also
    represents the area of valid data on 24K DRGs for the area. Because the neatline
    of paper quad maps was formed by a regular grid in geographic coordinates, NAD27,
    this dataset was generated from a regular grid defined in that coordinate system.
    In subsequent processing this grid was projected to geographic coordinates, NAD83.
    The projection was done to make this dataset compatible with other vector data in
    the same coordinate system. As a result, the area enclosed by each polygon in this
    index represents the same geographic area depicted on the corresponding paper map,
    but the latitude / longitude value for each polygon side and and corner in geographic
    coordinates, NAD83 are not exact multiples of full and half degrees. The grid is
    not totally regular. In the Chandeleur Islands area, the normal footprint of USGS
    maps were shifted a few minutes east and west to cover the area with the fewest
    map sheets.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
